    public static boolean checkRepetition(String s, int start, int end) {
        HashSet<Character> set = new HashSet<Character>();
        for (int i = start; i <= end; i++) {
            if (set.contains(s.charAt(i)))//at 0 th location boundary is checked
                return true;
            else
                set.add(s.charAt(i));
        }
        return false;
    }

